        // Custom marker styles
        function getMarkerColor(damageStatus) {
            if (damageStatus === "Damage") {
                return "red"; // Red for damaged buildings
            } else if (damageStatus === "Possible damage") {
                return "yellow"; // Yellow for possible damage
            } else {
                return "orange"; // Default color (can be changed if needed)
            }
        }

        // Add GeoJSON data to the map with styled markers
        var geoJsonLayer = L.geoJSON(structuresGeoJSON, {
            pointToLayer: function (feature, latlng) {
                var damageStatus = feature.properties.Damage_1;
                return L.circleMarker(latlng, {
                    radius: 8, // Size of the circle
                    fillColor: getMarkerColor(damageStatus), // Color based on damage status
                    color: "white", // Border color
                    weight: 1, // Border weight
                    opacity: 1, // Border opacity
                    fillOpacity: 0.7 // Fill opacity
                });
            },
            onEachFeature: function (feature, layer) {
                // Create a structured popup with all properties
                let popupContent = `  
                    <strong>Taroudan:</strong> ${feature.properties.Taroudan}<br>
                    <strong>EQ ID:</strong> ${feature.properties["EQ20230909"]}<br>
                    <strong>Date:</strong> ${feature.properties["2023-09-10"]}<br>
                    <strong>Damage Status:</strong> ${feature.properties.Damage}<br>
                    <strong>Damage Description:</strong> ${feature.properties.Damage_1}<br>
                    <strong>Building Status:</strong> ${feature.properties["Damaged Bu"]}<br>
                    <strong>Evaluation Status:</strong> ${feature.properties["To Be Eval"]}<br>
                    <strong>Pleiades:</strong> ${feature.properties.Pleiades}<br>
                    <strong>Validation Status:</strong> ${feature.properties["Not yet fi"]}<br>
                    <strong>VG Status:</strong> ${feature.properties.VG}<br>
                `;
                layer.bindPopup(popupContent);
            }
        }).addTo(map);

        // Zoom to the bounds of the GeoJSON data
        map.fitBounds(geoJsonLayer.getBounds());
   // Add a legend
   var legend = L.control({ position: 'bottomright' });

legend.onAdd = function () {
    var div = L.DomUtil.create('div', 'legend');
    div.innerHTML = `
        <div><span style="background-color: red;"></span> Damaged Buildings</div>
        <div><span style="background-color: yellow;"></span> Possible Damage</div>
    `;
    return div;
};

legend.addTo(map);
